import ModelData from './CatalogViewer.json';
import './css/catalogViewer.css';

function CatalogViewer(){
    return(
        <div className='catalog_viewer_container'>
            <nav>
                {ModelData.map(item =>(
                    <li key={item.id}>
                        <div className='img'>                            
                            <img src={item.url}/>
                            <p className='rate'>{item.rate}</p>
                        </div>
                        <div>
                            <p>{item.user}</p>
                            <p>{item.price}</p>
                        </div>
                    </li>
                ))}
            </nav>

        </div>
    );
}

export default CatalogViewer;
